import {useContext} from "react"

import { CategoryContext } from "../contexts/CategoryContext";

const Home = () => {
    const {bookCategories} = useContext(CategoryContext);
    return <div>
        <h1>Home</h1>
        <ul>
            {
                bookCategories.map((book) => <li>{book.categoryName}</li>)
            }
        </ul>
    </div>
}
export {Home};
